import './App.css';

class WhyHome extends Component {

    render(){
      return(
        <div className="howhome">
            <div className="whyhometitle center">
                How do I apply?
            </div>
            <div className="row">
                1.2.3.4
            </div>
        </div>
      )
    }
  }

export default WhyHome
